import React, {Component} from 'react';
import {SafeAreaView, Text} from "react-native";
import IconeLimpo from 'react-native-vector-icons/AntDesign';
import IconePreenchido from 'react-native-vector-icons/FontAwesome';

import {createMaterialTopTabNavigator} from "react-navigation-tabs";
import { createStackNavigator} from "react-navigation-stack";
import {createAppContainer} from "react-navigation";

import Feed from './pages/Feed';
import Perfil from './pages/Perfil';
import Explorar from './pages/Explorar';
import Adicionar from './pages/Adicionar';
import Favoritos from './pages/Favoritos';


export default class Routes extends Component{
    render(){
        return(
            <SafeAreaView style={{flex:1}}>
                <AppTabNavigator />
            </SafeAreaView>
        );
    }
}


const FeedStack = createStackNavigator({
    Feed:{
        screen: Feed,
    },
    Outros: Perfil
});

const AppTabNavigator = createAppContainer(
    createMaterialTopTabNavigator(
        {
            Feed: {
                screen: Feed,
                navigationOptions:{
                    tabBarIcon: () => (
                        <IconeLimpo name="home" size={25} color="#000000" />
                    ),
                }
            },

            Procurar: {
                screen: Procurar,
                navigationOptions: {
                    tabBarIcon: () => (
                        <IconeLimpo name="search1" size={25} color="#000000"/>
                    )
                }
            },

            Adicionar: {
                screen: Adicionar,
                navigationOptions:{
                    tabBarIcon: () => (
                        <IconeLimpo name="plussquareo" size={25} color="#000000" />
                    )
                }
            },

            Favoritos: {
                screen: Favoritos,
                navigationOptions:{
                    tabBarIcon: () => (
                        <IconeLimpo name="hearto" size={23} color="#000000"/>
                    )
                }
            },

            Perfil: {
                screen: Perfil,
                navigationOptions:{
                    tabBarIcon: ({focused}) => {
                        if(focused){
                            return <IconePreenchido name="user" size={30} color="#000000" />
                        }
                        return <IconePreenchido name="user-o" size={25} color="#000000" />

                    }
                }
            },


        }, {
            tabBarPosition: 'bottom',
            initialRouteName: 'Feed',

            tabBarOptions:{
                showIcon: true,
                showLabel: false,
                activeTintColor: '#FFFFFF',
                inactiveTintColor: '#F8F8F8',
                indicatorStyle:{
                    borderBottomColor: '#FAFAFA',
                    borderBottomWidth: 4,
                },
                labelStyle:{
                    textAlign: 'center'
                },
                style:{
                    backgroundColor: '#FAFAFA'
                }
            }
        }
    )
);
